function createTargetingProfile() {
  const ua = new window.UAParser()
  return {
    os: ua.getOS().name || '-',
    device: ua.getDevice().type || 'desktop',
    browser: ua.getBrowser().name || '-',
    country: '-',
    promiseToUpdate: getFullTargetingProfileAndStore().catch((e) => {}),
  }
}

