function deserializeQueryString(qsRaw) {
  return qsRaw
    .split('&')
    .filter(Boolean)
    .reduce(function (ret, rawParameter) {
      var parameter = rawParameter.split('=')
      ret[parameter[0]] = decodeURIComponent(parameter[1])
      return ret
    }, {})
}

